import React from "react";
import {
  SiHtml5,
  SiCss3,
  SiJavascript,
  SiJquery,
  SiPhp,
  SiReact,
  SiNodeDotJs,
  SiAmazon,
  SiMysql,
  SiMongodb,
  SiGit,
} from "react-icons/si";
import styled from "styled-components";
import palette from "../lib/styles/palette";
import Skill from "./Skill";

const SkillList = () => {
  return skills.map((skill) => <Skill key={skill.id} skill={skill}></Skill>);
};

const skills = [
  {
    id: 1,
    icon: <SiHtml5 />,
    color: "#E96328",
    category: "Front-end",
    name: "HTML",
    level: 5,
  },
  {
    id: 2,
    icon: <SiCss3 />,
    color: "#2A65F0",
    category: "Front-end",
    name: "CSS",
    level: 5,
  },

  {
    id: 3,
    icon: <SiJavascript />,
    color: "#F7DF1B",
    category: "Front-end",
    name: "JavaScript",
    level: 5,
  },

  {
    id: 4,
    icon: <SiJquery />,
    color: "#F7DF1B",
    category: "Front-end",
    name: "JQuery",

    level: 5,
  },
  {
    id: 5,
    icon: <SiReact />,
    color: "#F7DF1B",
    category: "Front-end",
    name: "React.js",
    level: 5,
  },
  {
    id: 6,
    icon: <SiPhp />,
    color: "#F7DF1B",
    category: "Back-end",
    name: "PHP",

    level: 5,
  },
  {
    id: 7,
    icon: <SiNodeDotJs />,
    color: "#F7DF1B",
    category: "Back-end",
    name: "Node.js",
