    color: "#F7DF1B",
    category: "Database",
    name: "MySql",
    level: 2,
  },
  {
    id: 10,
    icon: <SiMongodb />,
    color: "#F7DF1B",
    category: "Database",
    name: "MongoDB",
    level: 1,
  },
  {
    id: 11,
    icon: <SiGit />,
    color: "#F7DF1B",
    category: "Etc",
    name: "Git",
    level: 3,
  },
];

export default SkillList;
